options.styles:
.center {
	width: 300px;
	height: 198px;
	background: #fff;
	border-radius: 10px;
	overflow: hidden;
}

.profile {
	float: left;
	width: 200px;
	height: 320px;
	text-align: center;
	
	.image {
		position: relative;
		width: 70px;
		height: 70px;
		margin: 5px auto 0 auto;

		img {
			display: block;
		}
		
		&:hover {
			cursor: pointer;
			
		}
		
	}
	
	.name {
		font-size: 15px;
		font-weight: 600;
		margin-top: 5px;
	}
	
	.job {
		font-size: 11px;
		line-height: 15px;
	}
	
	.actions {
		margin-top: 5px;
		
		.btn {
			display: block;
			width: 80px;
			height: 20px;
			margin: 0 auto 3px auto;
			background: none;
			border: 1px solid #786450;
			border-radius: 15px;
			font-size: 12px;
			font-weight: 600;
			box-sizing: border-box;
			transition: all .3s ease-in-out;
			color: $brown;
			
			&:hover {
				background: $brown;
				color: #fff;
				background-color: black;
			}
		}
	}
	
}

.stats {
	float: left;
	
	.box {
		box-sizing: border-box;
		width: 90px;
		height: 65px;
		background: #EFEBFB;
		text-align: center;
		padding-top: 10px;
		transition: all .4s ease-in-out;
		
		&:hover {
			background: #E1CFC2;
			cursor: pointer;
		}
		
		&:nth-child(2) {
			margin: 1px 0;
		}
		
	}
	
	span {
		display: block;
	}
	
	.value {
		font-size: 18px;
		font-weight: 600;
	}
	
	.parameter {
		font-size: 11px;
	}
	
}
